lazy_static! {
    static ref PartitionCache: Mutex<HashMap<(Vec<usize>, usize, usize), Vec<Combination>>> = Mutex::new(HashMap::new());
}

fn partition(elements: &[usize], minlen: usize, maxlen: usize) -> Vec<Combination> {
    let mut cache = PartitionCache.lock().unwrap();
    let elements_vec = elements.to_vec();
    if cache.contains_key(&(elements_vec.clone(), minlen, maxlen)) {
        return cache[&(elements_vec, minlen, maxlen)].clone();
    }
    let t1: Instant = Instant::now();
    let mut rtn: Vec<Combination> = Vec::new();
    let mut lists: Vec<Vec<usize>> = Vec::new();
    let mut indexes: Vec<usize> = vec![0; elements.len()];
    lists.push(elements_vec.clone());
    loop {
        let mut combo = Combination {
            singles: Vec::new(),
            multiples: Vec::new(),
            multiples_flat: Vec::new(),
        };
        for list in &lists {
            if list.len() == 1 {
                combo.singles.push(list[0].clone());
            } else {
                combo.multiples.push(list.clone());
                combo.multiples_flat.extend(list.clone());
            }
        }
        let itotallen = combo.singles.len() + combo.multiples.len();
        if itotallen >= minlen && itotallen <= maxlen {
            rtn.push(combo);
        }
        
        let mut index: usize = 0;
        let mut bbreak: bool = false;
        let mut i: usize = indexes.len() - 1;
        loop {
            if i == 0 {
                bbreak = true;
                break;
            }
            index = indexes[i];
            let ilen = lists[index].len();
            lists[index].remove(ilen - 1);
            if lists[index].len() > 0 {
                break;
            }
            lists.remove(index);
            i -= 1;
        }
        if bbreak {
            break;
        }
        index += 1;
        if index >= lists.len() {
            lists.push(Vec::new());
        }
        while i < indexes.len() {
            indexes[i] = index;
            lists[index].push(elements[i].clone());
            index = 0;
            i += 1;
        }
    }
    cache.insert((elements_vec, minlen, maxlen), rtn.clone());
    /*
    Partitioned elements.len() = 4 in 0.00 seconds
    Partitioned elements.len() = 5 in 0.00 seconds
    Partitioned elements.len() = 6 in 0.00 seconds
    Partitioned elements.len() = 7 in 0.00 seconds
    Partitioned elements.len() = 8 in 0.01 seconds
    Partitioned elements.len() = 9 in 0.04-0.08 seconds
    Partitioned elements.len() = 10 in 0.35-0.43 seconds
    Partitioned elements.len() = 11 in 2.32-2.61 seconds
    Partitioned elements.len() = 12 in 17.22-23.40 seconds
    */
    println!("Partitioned elements.len() = {} in {:.2} seconds", elements.len(), t1.elapsed().as_secs_f64());
    return rtn;
}

